import './App.css';
import Category from './Category.js';
import Navi from './Navi.js'
import Product from './Product.js';
function App() {
  return (
    <div>
      <Container>
        <Row>
         <Navi/>
        </Row>
      </Container>


        <Category></Category>
        <Product></Product>
    </div>
  );
}

export default App;
